import React from 'react';
import Funnel from 'react-d3-funnel';

interface FunnelGraphProps {
    data: {label: string, value: number}[];
    width: number;
    height: number;
    bottomWidth?: number;
    bottomPinch?: number;
    sort?: boolean;
    label?: { fontSize: string; fill: string; }
    color?: {
        scale: string[],
        start: string,
        end: string
    }
}

const FunnelGraph: React.FC<FunnelGraphProps> = (props) => {
    return (
        <Funnel
            data={props.data}
            width={props.width}
            height={props.height}
            bottomWidth={props.bottomWidth}
            bottomPinch={props.bottomPinch}
            sort={props.sort}
            label={props.label}
            color={props.color}
        />
    );
}

export default FunnelGraph;
